CREATE TABLE superstore_raw (
    row_id INT,
    order_id VARCHAR(20),
    order_date DATE,
    ship_date DATE,
    ship_mode VARCHAR(50),
    customer_id VARCHAR(20),
    customer_name VARCHAR(100),
    segment VARCHAR(50),
    country VARCHAR(50),
    city VARCHAR(50),
    state VARCHAR(50),
    postal_code VARCHAR(20),
    region VARCHAR(50),
    product_id VARCHAR(20),
    category VARCHAR(50),
    sub_category VARCHAR(50),
    product_name VARCHAR(200),
    sales FLOAT,
    quantity INT,
    discount FLOAT,
    profit FLOAT
);






-- Customer's Table 
CREATE TABLE customers (
    customer_id VARCHAR(50) PRIMARY KEY,
    customer_name VARCHAR(100),
    segment VARCHAR(50),
    country VARCHAR(50),
    city VARCHAR(100),
    state VARCHAR(100),
    postal_code VARCHAR(20),
    region VARCHAR(50)
);

SELECT
    customer_id,
    MIN(customer_name),
    MIN(segment),
    MIN(country),
    MIN(city),
    MIN(state),
    MIN(postal_code),
    MIN(region)
FROM superstore_raw
GROUP BY customer_id;

-- ORDER's TAble 
CREATE TABLE orders (
    order_id VARCHAR(50) PRIMARY KEY,
    order_date DATE,
    ship_date DATE,
    ship_mode VARCHAR(50),
    customer_id VARCHAR(50),
    FOREIGN KEY (customer_id) REFERENCES customers(customer_id)
);

SELECT
    order_id,
    MIN(order_date),
    MIN(ship_date),
    MIN(ship_mode),
    MIN(customer_id)
FROM superstore_raw
GROUP BY order_id;

-- PRODUCT'S TABLE 
CREATE TABLE products (
    product_id VARCHAR(50) PRIMARY KEY,
    product_name VARCHAR(255),
    category VARCHAR(50),
    sub_category VARCHAR(50)
);

SELECT
    product_id,
    MIN(product_name),
    MIN(category),
    MIN(sub_category)
FROM superstore_raw
GROUP BY product_id;


-- ORDER_ITEMS TABLE
CREATE TABLE order_items (
    order_id VARCHAR(50),
    product_id VARCHAR(50),
    sales DECIMAL(10,2),
    quantity INT,
    discount DECIMAL(5,2),
    profit DECIMAL(10,2),
    FOREIGN KEY (order_id) REFERENCES orders(order_id),
    FOREIGN KEY (product_id) REFERENCES products(product_id)
);

SELECT
    order_id,
    product_id,
    sales,
    quantity,
    discount,
    profit
FROM superstore_raw 
WHERE quantity IS NOT NULL AND quantity != '';





